import React from "react";
import Typed from "typed.js";
import { useEffect, useRef } from "react";

const Main = () => {
  const el = useRef(null);

  useEffect(() => {
    const typed = new Typed(el.current, {
      strings: [
        "Designer.",
        "Developer.",
        "Entrepreneur",
        "Creator",
        "Problem Solver.",
        "Digital Dreamer",
      ],

      startDelay: 300,
      typeSpeed: 100,
      backSpeed: 100,
      backDelay: 100,
      loop: true,
      showCursor: true,
    });

    // Destropying
    return () => {
      typed.destroy();
    };
  }, []);
  return (
    <>
      <section data-scroll-index="0" className="bg-gray home-section">
        <div className="container">
          <div className="row gy-6  justify-center align-items-center">
            <div className="col-lg-8  align-items-center">
              <div className="home-intro one-page-nav text-center text-lg-start">
                <h6>
                  <span className="hi-emoji"> ðŸ‘‹,</span>My name is Kasim Kazmi
                </h6>

                <h1>
                  I'm a <span ref={el}></span>
                </h1>
                <p>Based in Canada.</p>
                <div className="btn-bar">
                  <a className="px-btn px-btn-theme" href="#">
                    Let's Start
                  </a>
                </div>
              </div>
            </div>
            <div className="col-lg-4 pt-3 pt-lg-0 mt-0">
              <div className="home-image text-center">
                <img
                  src="./assests/images/main.png"
                  title="Header image"
                  alt="Header image"
                />
              </div>
            </div>
          </div>
        </div>
      </section>
     
    </>
  );
};

export default Main;
